import '../components/InviteTrainee.css';






import React from 'react';

function InviteTrainee() {
  return (
    <div style={{textAlign:'center',marginTop:'4rem'}}>
      <h2>ฟอร์ม Invite Trainee ถูกย้ายไปที่หน้า Dashboard ของ Trainer แล้ว</h2>
    </div>
  );
}

export default InviteTrainee;
